const Blog = () =>
{
    const [ArticlesList, setArticlesList] = useState([
      {
        articlePicUrl : 'https://assets.entrepreneur.com/content/3x2/2000/20191219170611-GettyImages-1152794789.jpeg',
        title : 'ya Raya7 Win',
        description : 'sidi nibi w fara7na bih sla lah 3alih ya 3achgin rasolilah sala laho 3lih',
        hearts  : 34,
        comments : 435,
        AuthorName : 'Monsif Touhami',
        Date : '12 Aug 2003'

      },
    ]);

    return(
        <div>
          <Title>Article List</Title>

          <ArticlesList/>
        </div>
    );
}

export default Blog;
